class Path():

    def __init__(self, designation, squares):
        self.designation = designation
        self.squares = squares
        self.values = { z:False for z in squares }
        self.walk = squares
        # self.walks = [squares]

    def block(self, square):
        if square in self.squares:
            self.values[square] = True
            if square in self.walk:
                self.walk = self.walk[:self.walk.index(square)+1]

    def unblock(self, square):
        if square in self.squares:
            self.values[square] = False

            self.walk = []
            for square in self.squares:
                self.walk.append(square)
                if self.values[square]:
                    break

class Piece():
    def __init__(self, color, type_, location):
        self.color = color
        self.type_ = type_
        if color == 'w':
            self.hashtype = type_.upper()
        else:
            self.hashtype = type_.lower()
        self.designation = color + type_
        self.location = location
        self.raw_moves = {}
        if self.type_ == 'p':
            self.key_type = self.color + 'p'
        else:
            self.key_type = 'a' + self.type_
        self.init_moves()

    def __repr__(self):
        return self.designation + '@' + self.location

    def notation(self):
        if self.type_ == 'p':
            return self.location[0]
        else:
            return self.type_.upper()

    def lookup_moves(self):
        try:
            return ACT_MAP[self.location][self.key_type]
        except KeyError:
            return {}

    def init_moves(self):
        self.paths = {}
        self.old_heat = []
        self.directional_heat = []
        self.non_directional_heat = []
        try:
            self.raw_moves = ACT_MAP[self.location][self.key_type]
            for move_type in self.raw_moves.keys():
                if move_type in ['NE','SE','SW','NW','N','E','S','W']:
                    self.paths[move_type] = Path(move_type, self.raw_moves[move_type])
                else:
                    try:
                        self.non_directional_heat += self.raw_moves['t']
                    except KeyError:
                        pass
                    try:
                        self.non_directional_heat += self.raw_moves['e']
                    except KeyError:
                        pass
                    try:
                        self.non_directional_heat += self.raw_moves['+']
                    except KeyError:
                        pass

        except KeyError:
            pass

    def block(self, square):
        try:
            self.paths[SQ2PATH[(self.location, square)]].block(square)
        except KeyError:
            pass
        # for path in self.paths:
        #     path.block(square)

    def unblock(self, square):
        try:
            self.paths[SQ2PATH[(self.location, square)]].unblock(square)
        except KeyError:
            pass
        # for path in self.paths:
        #     path.unblock(square)

    def update_heat(self, accumulator):
        # substract old heat form the accumulator
        for hotspot in self.old_heat:
            acumulator.remove(hotspot)

        # add nondirectional heat
        accumulator += self.non_directional_heat

        # add directional heat
        accumulator += self.directional_heat

        return accumulator

    def heat(self, accumulator):
        self.directional_heat = []
        for path in self.paths.values():
            self.directional_heat += path.walk
        self.old_heat = self.non_directional_heat + self.directional_heat
        accumulator += self.old_heat
        return accumulator

    def old_heat(self):
        results = []
        for move_type, squares in self.non_directional_heat.items():
            if move_type in ['t', 'e', '+']:
                results.extend(squares)
        for path in self.paths:
            results.extend(path.walk(self.color))
        return results

